// src/pages/Dashboard.js

import React from 'react';
import SkillForm from '../components/SkillForm';
import UserList from '../components/UserList';

const Dashboard = () => {
  return (
    <div className="container mx-auto mt-8">
      <SkillForm />
      <UserList />
    </div>
  );
};

export default Dashboard;
